import './App.css';
import { Route, Routes, BrowserRouter as Router } from 'react-router-dom'; 
import Navbarr from './components/Navbarr';
import Slidesshow from './components/Slidesshow';
import Products from './components/Products';

function App() {
  return (
    <div>
      <Routes></Routes>
      <Navbarr/>
      <Slidesshow/>
      <Products/>
    </div>
  );
}

export default App;
